import React from "react";
import styled from "styled-components";

function TextField({ children }) {
  return <TextFieldWrapper>{children}</TextFieldWrapper>;
}

const TextFieldWrapper = styled.input`
  border: none;
  outline: none;
  border-radius: 32px;
  height: 32px;
  background: #fdc838;
  color: black;
  padding: 0 24px;
  cursor:pointer;
`;

export default TextField;
